import React, { Fragment, useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import { getOrder, transactionSuccess } from "../store/action.js";

import { orderService } from "../services/order.service.js";

export function PaymentSuccess() {
  const { orderId } = useParams();
  // const dispatch = useDispatch();
  // const { selectedOrder } = useSelector((state) => state.mediaModule);
  const [selectedOrder, setSelectedOrder] = useState();

  useEffect(() => {
    getSelectedOrder();
  }, []);
  useEffect(() => {
    console.log("selectedOrderselectedOrder", selectedOrder);
    if (selectedOrder) {
      getPaymentDetails()
    }
  }, [selectedOrder]);

  async function getSelectedOrder() {
    setSelectedOrder( await orderService.getOrderById(orderId) );
  };
  async function getPaymentDetails(){
  const paymentDetails =  await orderService.getPaymentDetails(selectedOrder.lowProfileCode);     
  console.log('paymentDetails',paymentDetails);
  orderService.updateOrder(orderId, paymentDetails)
  };
  return (
    <Fragment>
      <h2>{orderId}</h2>
      <h1>תודה שקניתם ספלינגגג</h1>
    </Fragment>
  );
}
